import React from "react";
import Test_1 from "../img/Test_1.jpeg";
import { TestDiv } from "../styledComponents";

const Test = () => {
  return (
    <div>
      <TestDiv>
        <h3>이것도 맞춰 보세요</h3>
        <div className="contentWrapper">
          <img src={Test_1} alt="Test_1"></img>
          <div className="buttonWrapper">
            <button className="option1">123</button>
            <button className="option2">123</button>
          </div>
        </div>
      </TestDiv>
    </div>
  );
};

export default Test;
